queryData.queryFunction:
this.getQuery = function (username,timeFrom,timeTo,timeUnit,componentName){let queryStringKeyValue = window.location.search.replace('?', '').split('&');
let qsJsonObject = {};
if (queryStringKeyValue != '') {
    for (let i = 0; i < queryStringKeyValue.length; i++) {
        qsJsonObject[queryStringKeyValue[i].split('=')[0]] = queryStringKeyValue[i].split('=')[1];
    }
}
let entryPoint = qsJsonObject.entryPoint;
let query = '';
if (entryPoint == 'undefined' || entryPoint == null) {
    query = "from MediatorStatAgg on componentName=='" + componentName + "' within " + 'time:dateFormat(convert(\'' + timeFrom + '\', \'long\'), \'yyyy-MM-dd HH:mm:ss\'), time:dateFormat(convert(\'' + timeTo + '\', \'long\'), \'yyyy-MM-dd HH:mm:ss\') per \'' + (timeUnit + 's')+ '\'' + " select minDuration as Minimum, maxDuration as Maximum, (totalDuration / noOfInvocation) as Average, AGG_TIMESTAMP as Time, time:dateFormat(AGG_TIMESTAMP, 'yyyy-MM-dd HH:mm:ss') as date group by AGG_TIMESTAMP";
}
else {
    query = "from MediatorStatAgg on entryPoint=='" + entryPoint + " AND componentName=='" + componentName + "' within " + 'time:dateFormat(convert(\'' + timeFrom + '\', \'long\'), \'yyyy-MM-dd HH:mm:ss\'), time:dateFormat(convert(\'' + timeTo + '\', \'long\'), \'yyyy-MM-dd HH:mm:ss\') per \'' + (timeUnit + 's')+ '\'' + " select minDuration as Minimum, maxDuration as Maximum, (totalDuration / noOfInvocation) as Average, AGG_TIMESTAMP as Time, time:dateFormat(AGG_TIMESTAMP, 'yyyy-MM-dd HH:mm:ss') as date group by AGG_TIMESTAMP";
}
console.log(query);
return query;}

